template <typename Scalar, int channels, int length>
inline void BatchNormalization_simple_mlp(Scalar * __restrict outputs, const Scalar * __restrict inputs, const Scalar * __restrict gamma, const Scalar * __restrict beta, const Scalar * __restrict mean, const Scalar * __restrict variance, const Scalar epsilon) noexcept
{
    //1d case or MLP case
    if constexpr (length == 1) 
    {
        for (int i = 0; i < channels; ++i) 
        {
            outputs[i] = gamma[i] * ((inputs[i] - mean[i]) / std::sqrt(variance[i] + epsilon)) + beta[i];
        }
    } 
    //multi-dimension case
    else 
    {
        for (int c = 0; c < channels; ++c) 
        {
            Scalar scale = gamma[c] / std::sqrt(variance[c] + epsilon);
            Scalar shift = beta[c] - mean[c] * scale;
            
            for (int t = 0; t < length; ++t) 
            {
                int idx = t * channels + c;
                outputs[idx] = inputs[idx] * scale + shift;
            }
        }
    }
}

template<typename Scalar, int output_size, typename ActFun>
inline void Dense_simple_mlp(Scalar* __restrict outputs, const Scalar* __restrict inputs, const Scalar * __restrict weights, const Scalar * __restrict biases, int input_size, ActFun activation_function, Scalar alpha) noexcept 
{
    for(int i = 0; i < output_size; ++i){
        Scalar sum = 0;
        
        for(int j = 0; j < input_size; ++j){
            sum += inputs[j] * weights[j * output_size + i];
        }
        sum += biases[i];
        activation_function(outputs[i], sum, alpha);
    }
}

template <typename Scalar, int channels, int length>
inline void LayerNormalization_simple_mlp(Scalar * __restrict outputs, const Scalar * __restrict inputs, const Scalar * __restrict gamma, const Scalar * __restrict beta, Scalar epsilon) noexcept
{
    //1d case or MLP case
    if constexpr (length == 1) 
    {
        Scalar mean = 0;
        Scalar variance = 0;
        
        for (int i = 0; i < channels; ++i) 
        {
            mean += inputs[i];
        }
        mean /= channels;
        
        for (int i = 0; i < channels; ++i) 
        {
            variance += (inputs[i] - mean) * (inputs[i] - mean);
        }
        variance /= channels;
        
        for (int i = 0; i < channels; ++i) 
        {
            outputs[i] = gamma[i] * ((inputs[i] - mean) / std::sqrt(variance + epsilon)) + beta[i];
        }
    } 
    //multi-dimension case
    else 
    {
        for (int c = 0; c < channels; ++c) 
        {
            // Compute mean for this channel across spatial dimensions
            Scalar mean = 0;
            for (int t = 0; t < length; ++t) 
            {
                int idx = t * channels + c;
                mean += inputs[idx];
            }
            mean /= length;
            
            Scalar variance = 0;
            for (int t = 0; t < length; ++t) 
            {
                int idx = t * channels + c;
                variance += (inputs[idx] - mean) * (inputs[idx] - mean);
            }
            variance /= length;
            
            Scalar scale = gamma[c] / std::sqrt(variance + epsilon);
            Scalar shift = beta[c] - mean * scale;
            
            for (int t = 0; t < length; ++t) 
            {
                int idx = t * channels + c;
                outputs[idx] = inputs[idx] * scale + shift;
            }
        }
    }
}

template <typename Scalar, int channels, int length>
inline void UnitNormalization_simple_mlp(Scalar * __restrict outputs,
                              const Scalar * __restrict inputs,
                              Scalar epsilon) noexcept
{
    //1d case or MLP case
    if constexpr (length == 1) {
        Scalar sum_sq = 0;
        for (int i = 0; i < channels; ++i) 
        {
            sum_sq += inputs[i] * inputs[i];
        }
        Scalar inv_norm = Scalar(1) / std::sqrt(sum_sq + epsilon);
        
        for (int i = 0; i < channels; ++i) 
        {
            outputs[i] = inputs[i] * inv_norm;
        }
    } 
    //multi-dimension case
    else 
    {
        for (int c = 0; c < channels; ++c) 
        {
            Scalar sum_sq = 0;
            for (int t = 0; t < length; ++t) 
            {
                int idx = t * channels + c;
                sum_sq += inputs[idx] * inputs[idx];
            }
            Scalar inv_norm = Scalar(1) / std::sqrt(sum_sq + epsilon);
            
            for (int t = 0; t < length; ++t) 
            {
                int idx = t * channels + c;
                outputs[idx] = inputs[idx] * inv_norm;
            }
        }
    }
}


